import Plugin from '@ckeditor/ckeditor5-core/src/plugin';
import Widget from '@ckeditor/ckeditor5-widget/src/widget';
import InsertCardioStressCommand from './insertcardiostresscommand';
import {
 toWidget,
 toWidgetEditable,
} from '@ckeditor/ckeditor5-widget/src/utils';

import { makeCalculations } from './utils';


export default class CardioStressEditing extends Plugin {

    static get requires() {
        return [ Widget ];
    }

    init() {
    	this._defineSchema();
    	this._defineConverters();
    	this._initializeEditorEvents();
        this.editor.commands.add( 'insertCardioStress', new InsertCardioStressCommand( this.editor ) );
    }

    _defineSchema() {
        const schema = this.editor.model.schema;

        schema.register( 'cardioStress', {
            isObject: true,
            allowWhere: '$block'
        } );

        schema.register( 'cardioStressTable', {
            allowIn: 'cardioStress',
            allowContentOf: '$block'
        } );

        schema.register( 'cardioStressRow', {
            allowIn: 'cardioStress',
            allowContentOf: '$block'
        } );

        schema.register( 'cardioStressImg', {
            isLimit: true,
            allowIn: 'cardioStress',
            allowAttributes: [ 'id','class', 'src' ]
        } );

        schema.register( 'cardioStressCaption', {
            allowIn: 'cardioStress',
        } );

        schema.register( 'cardioStressCell', {
            isLimit: true,
            allowIn: 'cardioStressRow',
            allowContentOf: '$block',
			allowAttributes: [ 'id','class','style' ]
        } );

        schema.register( 'cardioStressEditableField', {
            isLimit: true,
            allowIn: 'cardioStressRow',
			allowAttributes: [ 'id', 'class' ],
            allowContentOf: '$block'
        } );

        // schema.addChildCheck( ( context, childDefinition ) => {
        //     if ( context.endsWith( 'simpleBoxDescription' ) && childDefinition.name == 'simpleBox' ) {
        //         return false;
        //     }
        // } );
    }

    _defineConverters() {
        const conversion = this.editor.conversion;
       	var editableFields = [];
        let imagePath = "data:image/png;base64,";

        // <cardiostress-widget> converters
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStress',
            view: {
                name: 'div',
                classes: 'cardiostress-widget'
            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStress',
            view: ( modelElement, viewWriter ) => {
                const div = viewWriter.createContainerElement( 'div', { class: 'cardiostress-widget' } );
                return toWidget( div, viewWriter, { label: 'cardio stress widget' } );
            }
        } );

        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressImg',
            view: {
                name: 'img',
                src: imagePath,
                classes: 'img-stress'
            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressImg',
            view: ( modelElement, viewWriter ) => {
                console.log(modelElement);
                // const img = viewWriter.createEmptyElement( 'img', { src: modelElement.getAttribute('src') } );
                return viewWriter.createContainerElement( 'img', { src: imagePath } );
            }
        } );

        // <cardioStressCaption converters>
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressCaption',
            view: {
                name: 'span',
                // classes: true,

            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressCaption',
            view: ( modelElement, viewWriter ) => {
                return viewWriter.createContainerElement( 'span', { class: modelElement.getAttribute('class') , id: modelElement.getAttribute('id')} );
            }
        } );

        // <cardio> converters
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressTable',
            view: {
                name: 'table',
                // classes: 'cardiocomp-wrapper'
            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressTable',
            view: ( modelElement, viewWriter ) => {
                const table = viewWriter.createContainerElement( 'table', { class: modelElement.getAttribute('class')} );
                return viewWriter.createContainerElement( table, viewWriter, { label: 'cardio comp widget' } );
            }
        } );

        // <cardioRow> converters
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressRow',
            view: {
                name: 'tr',
                // classes: 'cardiocomp-row',

            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressRow',
            view: ( modelElement, viewWriter ) => {
                return viewWriter.createContainerElement( 'tr', { class: modelElement.getAttribute('class') } );
            }
        } );

        // <cardioCell> converters
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressCell',
            view: {
                name: 'td',
                // classes: 'cardiocomp-cell',
            }
        } );

        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressCell',
            view: ( modelElement, viewWriter ) => {
                return viewWriter.createContainerElement( 'td', { class: modelElement.getAttribute('class') } );
            }
        } );

        // <cardioEditableField> converters
        conversion.for( 'upcast' ).elementToElement( {
            converterPriority: 'highest',
            model: ( viewElement, modelWriter ) => {
                return modelWriter.createElement( 'cardioStressEditableField', { id: viewElement.getAttribute( 'id' ) } );
            },
            view: {
                name: 'td',
                // classes: 'cardio-editable-field'
            }
        } );
        conversion.for( 'downcast' ).elementToElement( {
            converterPriority: 'highest',
            model: 'cardioStressEditableField',
            view: ( modelElement, viewWriter ) => {
            	const id = modelElement.getAttribute('id');
                const td = viewWriter.createEditableElement( 'td', { class: 'cardiostress-editable-field', id: id } );
                if(id)
                	editableFields[id] = td;

                return toWidgetEditable( td, viewWriter );
            }
        } );
    }

    _initializeEditorEvents(){
		// this.editor.model.document.on( 'change:data', (evt, data) => {
		// 	let editor = this.editor
		//     let editableElement = editor.editing.view.document.selection.editableElement;
		//     if(editableElement && editableElement.hasClass('cardiocomp-editable-field')) {
	 //    		makeCalculations(editableElement.getAttribute('id'), editor);
		//     }
		// } );
    }
}

